import React from "react";
import Header from "../components/Header";

function debutantStar() {
  return (
    <>
      <i class="fa-solid fa-star lightYellow"></i>
      <i class="fa-solid fa-star darkYellow"></i>
      <i class="fa-solid fa-star darkYellow"></i>
    </>
  );
}

function intermediaireStar() {
  return (
    <>
      <i class="fa-solid fa-star lightYellow"></i>
      <i class="fa-solid fa-star lightYellow"></i>
      <i class="fa-solid fa-star darkYellow"></i>
    </>
  );
}

function ProStar() {
  return (
    <div className="star">
      <i className="fa-solid fa-star lightYellow"></i>
      <i className="fa-solid fa-star lightYellow"></i>
      <i className="fa-solid fa-star lightYellow"></i>
    </div>
  );
}

const Competences = () => {
  return (
    <div>
      <Header />
      <div className="content-competences">
        <div className="langage">
          <div className="langage-item">
            <i class="fa-brands fa-html5 logo"></i>
            <div className="star">
              <proStar />
            </div>
          </div>
          <div className="langage-item">
            <i class="fa-brands fa-css3 logo"></i>
            <proStar />
          </div>
          <div className="item"></div>
          <div className="item"></div>
          <div className="item"></div>
        </div>
      </div>
    </div>
  );
};

export default Competences;
